import React from 'react';

function List(props) {

    const list = [
        {
            content: "学习react",
            status: false,
        },
        {
            content: "扫地",
            status: false,
        },
        {
            content: "投简历",
            status: false,
        },
        {
            content: "背面试题",
            status: false,
        },
    ];

    function List(props) {
        
        const lis = list.map((item, index) => {
            return (
                <li>
                    <span>{item.content}</span>
                    <button>&times;</button>
                </li>
            )
        })
        return lis;
    }
    
    return (
        <div>
            List&times;
        </div>
    );
}

export default List;
